-------------- CREATING TABLES FOR RECURITERS DATA, OPENED_POSITIONS AND CANDIDATES_DATA-----------------
CREATE TABLE Recruiters_Data(
   Recruiter_Name VARCHAR(7) NOT NULL
  ,Req_ID         SERIAL  NOT NULL PRIMARY KEY
);

CREATE TABLE IF NOT EXISTS Opened_Positions(
   Closed_Date                 TIMESTAMP 
  ,Job_Title                   VARCHAR(17) NOT NULL
  ,Opened_Date                 TIMESTAMP  NOT NULL
  ,Recruiter_Name              VARCHAR(7) NOT NULL
  ,Req_ID                      INTEGER  NOT NULL 
  ,Source_of_Hire              VARCHAR(15) NOT NULL
  ,Job_Posting_Cost            INTEGER  NOT NULL
  ,Open_Reqs                   INTEGER  NOT NULL
  ,Position_opened_forin_Days INTEGER  NOT NULL
  ,Other_Costs                 INTEGER  NOT NULL
,PRIMARY KEY (Opened_Date)
  ,FOREIGN KEY (Req_ID) REFERENCES Recruiters_Data(Req_ID)

);



CREATE TABLE Candidates_data(
   Application_Date                   TIMESTAMP  
  ,Candidate_ID                       SERIAL  NOT NULL 
  ,Closed_Date                        TIMESTAMP  NOT NULL
  ,CurrentYearsOfcandidate_experience VARCHAR(1) NOT NULL
  ,"CurrentYear_cost_per hire"        VARCHAR(1)
  ,Current_Year_Offer_acceptance      VARCHAR(1) NOT NULL
  ,Current_Year_time_to_fill_bool     VARCHAR(1) NOT NULL
  ,Current_Year_time_to_hire          VARCHAR(1) NOT NULL
  ,Job_Title                          VARCHAR(17) NOT NULL
  ,Offer_Date                         TIMESTAMP 
  ,Offer_Status                       VARCHAR(10)
  ,Onsite_Date                        TIMESTAMP 
  ,Opened_Date                        TIMESTAMP  NOT NULL
  ,Phone_Screen_Date                  TIMESTAMP  NOT NULL
  ,Recruiter_Name                     VARCHAR(7) NOT NULL
  ,Rejected_By                        VARCHAR(9)
  ,Rejection_Reason                   VARCHAR(27)
  ,Req_ID                             INTEGER  NOT NULL
  ,Source_of_Hire                     VARCHAR(15) NOT NULL
  ,Candidate_Experience_Rating        VARCHAR(1) NOT NULL
  ,Job_Posting_Cost                   VARCHAR(3) NOT NULL
  ,Other_Costs                        VARCHAR(3) NOT NULL  
  ,PRIMARY KEY (Candidate_ID)
  ,FOREIGN KEY (Req_ID) REFERENCES Recruiters_Data(Req_ID)

);


